	[87363929767937] = { id = 20341, level = 1, desc_info = "点击骇入按钮，进入骇入状态，将<color=#dd4e2d>高亮</color>显示周遭环境中的【可交互物体】，并出现<color=#dd4e2d>准心</color>。将准心移至高亮物体，可进行骇入，包括：\n·骇入<color=#dd4e2d>飞行器</color>，可操作飞行器上升、下降、左右移动；若人物站在飞行器上，还可随飞行器一同移动；·若骇入<color=#dd4e2d>怪物</color>，可查看怪物信息；\n·骇入<color=#dd4e2d>人物</color>，可查看该人物信息", fight_magic = {}, fight_marks = {}, need_gold = 0, need_item = {}, simple_desc = "点击骇入按钮，进入骇入状态，将<color=#dd4e2d>高亮</color>显示周遭环境中的【可交互物体】，并出现<color=#dd4e2d>准心</color>。将准心移至高亮物体，可进行骇入，包括：\n·骇入<color=#dd4e2d>飞行器</color>，可操作飞行器上升、下降、左右移动；若人物站在飞行器上，还可随飞行器一同移动；\n·骇入<color=#dd4e2d>怪物</color>，可查看怪物信息；\n·骇入<color=#dd4e2d>人物</color>，可查看该人物信息", video = "",},
	[87368224735233] = { id = 20342, level = 1, desc_info = "点击骇入按钮，切换至<color=#dd4e2d>建造页签</color>，可消耗<color=#dd4e2d>建造能源</color>，可以在周边进行【建造】。包括：·制造<color=#dd4e2d>飞行器</color>，可骇入后操作飞行器进行飞行；\n·制造<color=#dd4e2d>机匣</color>，机匣可<color=#dd4e2d>攀爬</color>，可通过建造多个机匣后攀爬，到达无法抵达的地点", fight_magic = {}, fight_marks = {}, need_gold = 0, need_item = {}, simple_desc = "点击骇入按钮，切换至<color=#dd4e2d>建造页签</color>，可消耗<color=#dd4e2d>建造能源</color>，可以在周边进行【建造】。包括：·制造<color=#dd4e2d>飞行器</color>，可骇入后操作飞行器进行飞行；\n·制造<color=#dd4e2d>机匣</color>，机匣可<color=#dd4e2d>攀爬</color>，可通过建造多个机匣后攀爬，到达无法抵达的地点", video = "",},
	[129325760249857] = { id = 30111, level = 1, desc_info = "<size=24><color=#dd4e2d>脱战释放：</color></size>\n在敌人背后且满足暗杀距离时，可以对敌人释放<color=#e89e1d>【刺杀】</color>，<color=#e89e1d>完美刺杀</color>可<color=#e89e1d>直接歼灭</color>普通怪物，对精英和BOSS造成基础<color=#e89e1d>20%最大生命值</color>的伤害。\n·角色等级高于精英/BOSS越多，伤害越高，反之越低；\n·提升技能等级可以增加可暗杀距离和暗杀伤害\n\n<size=24><color=#dd4e2d>战斗中：</color></size>\n时间停滞，召唤离歌向敌人发起<color=#e89e1d>【冲刺上挑】</color>，命中敌人后携带角色向被击飞的目标发起连携攻击，造成携带角色<color=#e89e1d>100%</color>攻击力的伤害。", fight_magic = {}, fight_marks = {6200100801,}, need_gold = 0, need_item = {}, simple_desc = "脱战释放时，【刺杀】对精英和BOSS造成基础<color=#e89e1d>20%</color>最大生命的伤害；战斗中释放时，【冲刺上挑】连携攻击造成携带角色<color=#e89e1d>100%</color>攻击力的伤害。", video = "",},
